import React from "react";

export class goalType extends React.Component {
  next = (e) => {
    e.preventDefault();
    this.props.nextStep();
  };

  render() {
    const { values, handleChange } = this.props;
    return (
      <div>
        <button>Personal</button>
        <button>Social Button</button>
      </div>
    );
  }
}
